insert  into `ip_inline_value_language`(`plugin`,`key`,`languageId`,`value`) values ('inline_management','txt_news_title4',1,''),('inline_management','txt_carta_text4',1,'<p>La Cerveceria Oldenburg de Madrid, conocida por su Record Guinness, pone a la venta todo tipo de cervezas y comidas vía Web. A través de esta página podrás adquirir las tan selectas cervezas que tienes el placer de degustar en el local y por si esto no fuera suficiente, cuentas con la total confianza de más de 25 años de experiencia. Además estarás asesorado en todo momento por el maestro cervecero Jose Luis Ramírez y Juan Carlos Cabezón. Si tienes alguna duda con tu elección de las cervezas o cualquier otro tema relacionado con ellas, no dudes en ponerte en contacto con ellos. En la parte inferior de la página encontrarás todas las cervezas que ofertamos y también podrás descargar la carta completa en formato PDF.</p>'),('inline_management','txt_carta_title4',1,'<p>Carta</p>');

