insert  into `ip_noticias`(`id`,`row_number`,`image`,`abstract`,`date`,`creation_date`,`title`,`pid`,`text`,`link`) values (2,0,'jose_luis.jpg','Famosa por figurar en el libro Guinness como el establecimiento que más variedad de cervezas ofrece por metro cuadrado','0000-00-00 00:00:00','2016-05-17 19:06:19','Bares',20,NULL,NULL),(3,-1,'jose_luis.jpg','Famosa por figurar en el libro Guinness como el establecimiento que más variedad de cervezas ofrece por metro cuadrado','2014-03-09 23:00:00','2016-05-17 19:06:59','2',21,NULL,NULL),(4,0,'jose_luis.jpg','Famosa por figurar en el libro Guinness como el establecimiento que más variedad de cervezas ofrece por metro cuadrado','0000-00-00 00:00:00','2016-05-17 19:06:19','Bares2',20,NULL,NULL),(5,-1,'jose_luis.jpg','Famosa por figurar en el libro Guinness como el establecimiento que más variedad de cervezas ofrece por metro cuadrado','2014-03-09 23:00:00','2016-05-17 19:06:59','Salud Cervecera',21,NULL,NULL),(7,-2,'jose_luis.jpg','Famosa por figurar en el libro Guinness como el establecimiento que más variedad de cervezas ofrece por metro cuadrado','2016-05-12 00:00:00','2016-05-17 21:20:34','Prueba',23,'Fundada hace 25 años, la cervecería Oldenburg (Alburquerque, 13) no sólo es una de las más emblemáticas de Madrid, también es famosa por figurar en el libro Guinness como el establecimiento que más variedad de cervezas ofrece por metro cuadrado. O lo que es lo mismo: en algo menos de 15 m2 es posible encontrar hasta 300 marcas embotelladas y casi media docena de barril. Un espacio diminuto dirigido desde el principio por José Luis Ramírez y que desde hace muy poco cuenta con una sucursal muy cerca de la dirección original.','');

